import React from "react";

import mainImage from '../assets/mainImage.png';
import dummy from '../assets/dummy.png';

import '../style/Home.css';

function Home() {
    return (
        <>
            <section className="">
                <div className="bg-[#141413]">
                    <div className="flex">
                        {/* first div for menu */}
                        <div>

                            <div>
                                <img src="" alt="vishal" />
                            </div>

                            <div>
                                <ul>
                                    <li className="text-[#b6b5b0]">Home</li>
                                    <li>About Me</li>
                                    <li>Experience</li>
                                    <li>My Work</li>
                                    <li>Skills</li>
                                    <li>Connect With Me</li>
                                </ul>
                            </div>

                        </div>
                        {/* second div for middle content and heading  */}
                        <div>

                        </div>

                        {/* third div for profile with image */}
                        <div>

                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default Home;
